        private static void DoTestItem(string barfldval, string barfldprn, string Code128IDAutomation)
        {
            //Console.WriteLine();
            var code128 = new Code128();
            var myCode128String = code128.Encode(barfldval);
            string uglyEndcoded = code128.UglyEncode(myCode128String);

            TestCount++;

            if (uglyEndcoded.Trim() != barfldprn.Trim())
            {
                DiffCount++;
                Console.WriteLine();
                //Console.WriteLine("FI ==> | " + barfldval + " | " + barfldprn + " | " + Code128IDAutomation + " | ");
                //Console.WriteLine("Al ==> | " + barfldval + " | " + uglyEndcoded + " | " + myCode128String + " | ");
                Console.WriteLine("\"" + barfldval + "\" => \"" + myCode128String + "\"");
                Console.WriteLine(barfldprn);
                Console.WriteLine(uglyEndcoded);
                Console.WriteLine(GetExpString(myCode128String));
                Console.WriteLine(GetDiffString(barfldprn, uglyEndcoded));
            }
        }

        private static string GetExpString(string str1)
        {
            StringBuilder sb = new StringBuilder(str1.Length * 3);
            for (int i = 0; i < str1.Length; i++)
            {
                char c1 = str1[i];
                sb.Append(c1);
                sb.Append("  ");
            }
            return sb.ToString();
        }
        private static string GetDiffString(string str1, string str2)
        {
            StringBuilder sb = new StringBuilder(str1.Length);
            for (int i = 0; i < str1.Length; i++)
            {
                char c1 = str1[i];
                char c2 = str2[i];
                char m = (c1 == c2 ? ' ' : '^');
                sb.Append(m);
            }
            return sb.ToString();
        }
